const OneProducts = (props) => {
    const[product] = props;
    const {id,title,author,imgPath,price} = product
  return (
    <div>
         <img src= {imgPath} alt="book" style={{width:'200px',height:'200px'}} />
         <h3>{title}</h3>
         <i>{author}</i>
         <b>{price}</b>

         <button>Add to Cart</button>
      
    </div>
  )
}

export default OneProducts
